import React from "react"
import { NavLink } from "react-router-dom"


function NavBar() {
    return (
        <div className="navigation">
            <nav className="navbar navbar-expand navbar-dark bg-dark">
                <div className="container">
                    <NavLink to="/" className="navbar-brand">
                        Journey Through Code
                    </NavLink>
                    <div>
                        <ul className="navbar-nav ml-auto">
                            <li className="nav-item">
                            <NavLink to="/about" className="col-1 m-1 ms-5 border-bottom border-light">About Me</NavLink>
                            </li>
                        </ul>
                    </div>
                </div>

                <NavLink to="/about" className="col-1 m-1 ms-5 border-bottom border-light">About Me</NavLink>
                <NavLink to="/blogs" className="col-1 m-1 ms-5 border-bottom border-light">Blogs</NavLink>
                <NavLink to="/contact" className="col-1 m-1 ms-5 border-bottom border-light">Contact Me</NavLink>
            </nav>
        </div>
    )
}

export default NavBar;




